import React from "react";
import * as RIcons from "react-icons/fa";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <div className="navbar">
        <Link to="#" className="menu-bars">
          <RIcons.FaBars />
        </Link>
      </div>
    </div>
  );
}

export default Navbar;
